contracts/Bank.sol.content:
//SPDX-License-Identifier:MIT
pragma solidity ^0.8.17;
contract Bank{
     address public owner;
     constructor(){
         owner = msg.sender;
     }
     mapping(address => uint) public balances;
     function addBalance(uint amount) public {
         require(owner == msg.sender, "Your are not the owner !");
         balances[msg.sender]+= amount;
     }
     function getBalance(address _add) public view returns(uint){
         return balances[_add];
     }
     function transferCheck(address receiver,uint amount) public{
         require(msg.sender != receiver, "Can't Transfer");
         require(balances[msg.sender] >= amount, "Insufficient funds");
         transfer(msg.sender,receiver,amount);
     }
     function transfer(address from,address to,uint amount) public{
        balances[from]-= amount;
        balances[to] += amount;
     }
}

